lB("common/option.effekt",'module option\n\nimport effekt\nimport exception\n\ntype Option[A] {\n  None();\n  Some(value: A)\n}\n\ndef isDefined[A](self: Option[A]): Bool \x3d self match {\n  case None()  \x3d\x3e false\n  case Some(v) \x3d\x3e true\n}\n\ndef isEmpty[A](self: Option[A]): Bool \x3d\n  self.isDefined.not\n\ndef orElse[A](self: Option[A]) { that: \x3d\x3e Option[A] }: Option[A] \x3d self match {\n  case None()  \x3d\x3e that()\n  case Some(v) \x3d\x3e Some(v)\n}\n\ndef getOrElse[A](self: Option[A]) { that: \x3d\x3e A }: A \x3d self match {\n  case None() \x3d\x3e that()\n  case Some(v) \x3d\x3e v\n}\n\ndef map[A, B](self: Option[A]) { f: A \x3d\x3e B }: Option[B] \x3d self match {\n  case None()  \x3d\x3e None()\n  case Some(v) \x3d\x3e Some(f(v))\n}\n\ndef foreach[A](self: Option[A]) { f: A \x3d\x3e Unit }: Unit \x3d self match {\n  case None()  \x3d\x3e ()\n  case Some(v) \x3d\x3e f(v)\n}\n\ndef value[A](self: Option[A]): A / Exception[MissingValue] \x3d self match {\n  case None() \x3d\x3e do raise(MissingValue(), "Trying to get the value of an empty option") match {}\n  case Some(v) \x3d\x3e v\n}\n\ndef option[A] { p: \x3d\x3e A / Exception[MissingValue] }: Option[A] \x3d\n  try { Some(p()) }\n  with Exception[MissingValue] { def raise(_, _) \x3d None() }\n\ndef option[A, E](proxy: on[E]) { p: \x3d\x3e A / Exception[E] }: Option[A] \x3d\n  try { Some(p()) }\n  with Exception[E] { def raise(_, _) \x3d None() }\n\n// Interop with FFI\n// ---------------\n// These functions should only be used by libraries that interface with FFI\ndef undefinedToOption[A](value: A): Option[A] \x3d\n  if (value.isUndefined) { None() } else { Some(value) }\n\n\n// Show Instances\n// --------------\n\n\ndef println(o: Option[Int]): Unit \x3d println(show(o))\ndef println(o: Option[Double]): Unit \x3d println(show(o))\ndef println(o: Option[Bool]): Unit \x3d println(show(o))');
